class ExchangeRecord {
  ExchangeRecord({
      this.total, 
      this.currPage, 
      this.totalPage, 
      this.hasNext, 
      this.data,});

  ExchangeRecord.fromJson(dynamic json) {
    total = json['total'];
    currPage = json['curr_page'];
    totalPage = json['total_page'];
    hasNext = json['has_next'];
    if (json['data'] != null) {
      data = List.empty(growable: true);
      json['data'].forEach((v) {
        data?.add(Record.fromJson(v));
      });
    }
  }
  int? total;
  int? currPage;
  int? totalPage;
  bool? hasNext;
  List<Record>? data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['total'] = total;
    map['curr_page'] = currPage;
    map['total_page'] = totalPage;
    map['has_next'] = hasNext;
    if (data != null) {
      map['data'] = data?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

